import React, { useEffect, useState } from "react";
import Parse from "parse";

import "./../../App.css";
import "./ChatRoom.css";

// COMPONENTS
import ChatSetup from "../../api/ChatSetup";
import PageTitle from "../../components/PageTitle/PageTitle";
import BackArrow from "../../components/BackArrow/BackArrow";

export default function ChatRoom(props) {
  console.log("Chatroom selected user ", props.selectedUser);
  const [receiver, setReceiver] = useState("");

  useEffect(() => {
    if (receiver.id === undefined) {
      setReceiver(props.selectedUser);
    }
  });
  console.log("Chatroom receiver ", receiver);

  return (
    <div>
      <header>
        <BackArrow to="/discover" />
        {/* <ChatRoomHeading Component goes here */}
        <div>
          <div className="chat-room-title">
            <PageTitle title="Chat Room" />
          </div>
        </div>
      </header>
      <div>{/*Insert active chat Here*/}</div>

      <ChatSetup receiver={receiver} setReceiver={setReceiver} />
    </div>
  );
}
